    exportPDF : function (component, event,isMail){
        //Creo il file
        var doc = new jsPDF('p', 'pt', 'a4');
        //CREO IL TESTO
        this.createPage(doc, component, event);
        //SALVO IL FILE
        var blob = doc.output("blob");
        if (isMail){
            return blob;
        }else{
            this.downloadFile(component, blob, "DichiarazioneAdeguatezza" , "pdf");
        }
        //doc.save("Adeguatezza.pdf");
    },
